-- rcv1421e-28 --    beautiful and impecable house in a very nice neighborhood, close to the park and the beach.with high end finishings and very tradicional mexican details here and there.this house offers you very nice and open indoor &nbsp;spaces and very cozy outdoor areas.3 very good size bedrooms and 2.5 bathrooms, wonderful kitchen with a movable granite island and plenty cedar cabinetry.it includes air conditioners, all appliances (two fridges) and stainless steel bbq and grill in the outdoor kitchen.let&acute;s see it!  
&nbsp;  
linda e impecable; esta casa se localiza en un fraccionamiento &nbsp;muy lindo y seguro, adem&aacute;s a unos pasos del parque y de la playa.tiene muy finos terminados con detalles muy mexicanos por aqui y por all&aacute;.esta casa le ofrece muy amplios espacios interiores y un patio con jardines muy hogare&ntilde;o.cuenta con tres rec&aacute;maras amplias y dos y medio ba&ntilde;o adem&aacute;s de area para televisi&oacute;n.una cocina muy funcional con una isla movible con cubierta de granito y bastantes gabinetes.incluye aires acondicionados en todas las piezas y todos los electrodom&eacute;sticos.en la cocina exterior tiene asadores de acero inoxidable.&iexcl; vamos a verla!

-- rcv1258e-28 --    enjoy beautiful gardens and &nbsp;the peace that provides the privacy of this charming neighborhood.it is a house designed to be enjoyed in all its spaces located in el secreto, a residential complex of added value, controlled access, beautiful green and common areas with basketball court and pool, playground and a great palapa, the perfect place to share with friends and family.&nbsp;its convenient proximity to schools, shopping areas and the beach make it a perfect investment opportunity.this spacious home has three bedrooms, a bathroom and an additional tv room that can be used as a fourth bedroom, office or utility room.the master bedroom has a private bathroom and the house has a laundry area, terrace, patio and parking area for two cars.the advantages are undeniable : tranquility, family life, exclusivity and great price !!!  
&nbsp;  
disfrute de hermosos jardines y de la paz que provee la privacidad de este encantador fraccionamiento.es una casa dise&ntilde;ada para disfrutarse en todos sus espacios ubicada en el secreto, un conjunto residencial de gran plusvalia con acceso controlado, preciosas &aacute;reas verdes, &aacute;reas comunes con cancha de basquet y alberca, juegos infantiles y una gran palapa ideal para compartir con amigos y familiares.&nbsp;su conveniente cercania a colegios, &aacute;reas comerciales y a la playa lo hacen mas apetecible para una inversion patrimonial.esta espaciosa casa cuenta con tres habitaciones un cuarto de tv y una habitacion adicional que puede ser usada como una cuarta recamara, oficina o cuarto de servicio.la recamara principal tiene ba&ntilde;o privado y la casa cuenta con &aacute;rea de lavado, terraza, patio y &aacute;rea de estacionamiento para dos autos.las ventajas saltan a la vista: tranquilidad, vida familiar, exclusividad y un excelente precio!!!

-- rcv957e-28 --    spacious property located in lomas de mazatlan main street, perfect for comercial or residential purpose. this house was adapted for a coffee shop. the property has a big parking area that can accomodate 4 cars. the main level has a spacious living/dinning area, a large kitchen with stainless steel working tables and industrial sink. nice interior patio with fountain, half bathroom, studio and a large bedroom with full bathroom, walk in closet and a small patio.  the second level has 2 large bedrooms, each one with large cedar wood closets and private bathroom,  an extra room with full bath that can be used as maids quarters, studio or a fourth bedroom, it also has a good size laundry patio.  the location of this property, in a high traffic upscale street is perfect for buissness such as restaurant, cofee place, corporative officces, school, spa and many more...  
&nbsp;  
&nbsp;  
&nbsp;  
amplia casa ubicada en la avenida principal de lomas de mazatlan, excelente para uso comercial/residencial. esta propiedad cuenta con algunas adptaciones para restaurante/cafeteria. el area de estacionamiento se puede adecuar para 4 autos. la planta baja cuenta con una espaciosa area de sala/comedor, medio ba&ntilde;o, estudio, amplia cocina con mesas de trabajo de acero inoxidable y fregadero industrial, patio interior con fuente y una espaciosa habitacion con ba&ntilde;o completo, walk-in closet  y un peque&ntilde;o patio adicional.  en el segundo nivel tiene dos recamaras, cada una con closets de cedro y ba&ntilde;o, un patio de lavado y una tercera habitacion con ba&ntilde;o completo que puede usarse como estudio, cuarto de servicio, o cuarta habitacion. la privilegiada ubicacion de esta propiedad la hace excelente para uso comercial, ya sea un restaurante, cafeteria, oficinas corporativas, escuela, clinica, spa y mucho mas....
